void test_common_type() {
  static_assert(IS<etr::common_type_t<decltype(false), decltype(true)>, Logical> , "bool, bool -> Logical");
  static_assert(IS<etr::common_type_t<decltype(1), decltype(true)>, Integer> , "int, bool -> Integer");
  static_assert(IS<etr::common_type_t<decltype(1.23), decltype(true)>, Double> , "double, bool -> Double");
  static_assert(IS<etr::common_type_t<decltype(Logical(true)), decltype(true)>, Logical> , "Logical, bool -> Logical");
  static_assert(IS<etr::common_type_t<decltype(Integer(1)), decltype(true)>, Integer> , "Integer, bool -> Integer");
  static_assert(IS<etr::common_type_t<decltype(Double(1.1)), decltype(true)>, Double> , "Double, bool -> Double");
  static_assert(IS<etr::common_type_t<decltype(Dual(1.1, 0.0)), decltype(true)>, Dual> , "Dual, bool -> Dual");

  static_assert(IS<etr::common_type_t<decltype(false), decltype(1)>,Integer> , "bool, int-> Integer");
  static_assert(IS<etr::common_type_t<decltype(1), decltype(1)>, Integer> , "int, int-> Integer");
  static_assert(IS<etr::common_type_t<decltype(1.23), decltype(1)>, Double> , "double, int-> Double");
  static_assert(IS<etr::common_type_t<decltype(Logical(true)), decltype(1)>, Integer> , "Logical, int-> Integer");
  static_assert(IS<etr::common_type_t<decltype(Integer(1)), decltype(1)>, Integer> , "Integer, int-> Integer");
  static_assert(IS<etr::common_type_t<decltype(Double(1.1)), decltype(1)>, Double> , "Double, int-> Double");
  static_assert(IS<etr::common_type_t<decltype(Dual(1.1, 0.0)), decltype(1)>, Dual> , "Dual, int-> Dual");

  static_assert(IS<etr::common_type_t<decltype(false), decltype(1.1)>, Double> , "bool,double-> Double");
  static_assert(IS<etr::common_type_t<decltype(1), decltype(1.2)>, Double> , "int, double-> Double");
  static_assert(IS<etr::common_type_t<decltype(1.23), decltype(1.2)>, Double> , "double, double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Logical(true)), decltype(1.2)>, Double> , "Logical, double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Integer(1)), decltype(1.2)>, Double> , "Integer, double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Double(1.1)), decltype(1.2)>, Double> , "Double, double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Dual(1.1, 0.0)), decltype(1.2)>, Dual> , "Dual, double-> Dual");

  static_assert(IS<etr::common_type_t<decltype(false), decltype(Logical(true))>, Logical> , "bool, Logical->Logical");
  static_assert(IS<etr::common_type_t<decltype(1), decltype(Logical(true))>, Integer> , "int, Logical->Integer");
  static_assert(IS<etr::common_type_t<decltype(1.23), decltype(Logical(true))>, Double> , "double, Logical-> Double");
  static_assert(IS<etr::common_type_t<decltype(Logical(true)), decltype(Logical(true))>, Logical> , "Logical, Logical-> Logical");
  static_assert(IS<etr::common_type_t<decltype(Integer(1)), decltype(Logical(true))>, Integer> , "Integer, Logical-> Integer");
  static_assert(IS<etr::common_type_t<decltype(Double(1.1)), decltype(Logical(true))>, Double> , "Double, Logical-> Double");
  static_assert(IS<etr::common_type_t<decltype(Dual(1.1, 0.0)), decltype(Logical(true))>, Dual> , "Dual, Logical-> Dual");

  static_assert(IS<etr::common_type_t<decltype(false), decltype(Integer(10))>, Integer> , "bool, Integer->Integer");
  static_assert(IS<etr::common_type_t<decltype(1), decltype(Integer(10))>, Integer> , "int, Integer->Integer");
  static_assert(IS<etr::common_type_t<decltype(1.23), decltype(Integer(10))>, Double> , "double, Integer-> Double");
  static_assert(IS<etr::common_type_t<decltype(Logical(true)), decltype(Integer(10))>, Integer> , "Logical, Integer-> Integer");
  static_assert(IS<etr::common_type_t<decltype(Integer(1)), decltype(Integer(10))>, Integer> , "Integer, Integer-> Integer");
  static_assert(IS<etr::common_type_t<decltype(Double(1.1)), decltype(Integer(10))>, Double> , "Double, Integer-> Double");
  static_assert(IS<etr::common_type_t<decltype(Dual(1.1, 0.0)), decltype(Integer(10))>, Dual> , "Dual, Integer-> Dual");

  static_assert(IS<etr::common_type_t<decltype(false), decltype(Double(10.23))>, Double> , "bool, Double-> Double");
  static_assert(IS<etr::common_type_t<decltype(1), decltype(Double(10.23))>, Double> , "int, Double-> Double");
  static_assert(IS<etr::common_type_t<decltype(1.23), decltype(Double(10.23))>, Double> , "double, Double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Logical(true)), decltype(Double(10.23))>, Double> , "Logical, Double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Integer(1)), decltype(Double(10.23))>, Double> , "Integer, Double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Double(1.1)), decltype(Double(10.23))>, Double> , "Double, Double-> Double");
  static_assert(IS<etr::common_type_t<decltype(Dual(1.1, 0.0)), decltype(Double(10.23))>, Dual> , "Dual, Double-> Dual");

  static_assert(IS<etr::common_type_t<decltype(false), decltype(Dual(10.234, 0.0))>, Dual> , "bool, Dual-> Dual");
  static_assert(IS<etr::common_type_t<decltype(1), decltype(Dual(10.234, 0.0))>, Dual> , "int, Dual-> Dual");
  static_assert(IS<etr::common_type_t<decltype(1.23), decltype(Dual(10.234, 0.0))>, Dual> , "double, Dual-> Dual");
  static_assert(IS<etr::common_type_t<decltype(Logical(true)), decltype(Dual(10.234, 0.0))>, Dual> , "Logical, Dual-> Dual");
  static_assert(IS<etr::common_type_t<decltype(Integer(1)), decltype(Dual(10.234, 0.0))>, Dual> , "Integer, Dual-> Dual");
  static_assert(IS<etr::common_type_t<decltype(Double(1.1)), decltype(Dual(10.234, 0.0))>, Dual> , "Double, Dual-> Dual");
  static_assert(IS<etr::common_type_t<decltype(Dual(1.1, 0.0)), decltype(Dual(10.234, 0.0))>, Dual> , "Dual, Double-> Dual");
}

